def find_intersection(set1:set, set2:set):
    """
    Return a new set with elements present in both set1 and
    set2.
    """
    intersection = set()

    for i in set1:
        if i in set2:
            intersection.add(i)
            set2.remove(i)

    for i in set2:
        if i in set1:
            intersection.add(i)
    return intersection

